import {ListItem} from "../ListItem";
import {Button} from "../Button";

export const ManagerList = (props) => {
    const { managerList } = props;
    return (
        <div>
            { managerList.map((value) => {
                return <ListItem title={`${value.firstName} ${value.lastName}`} />
            })}
            <Button type="action">Добавить</Button>
        </div>
    );
}
